import { useEffect, useState } from 'react';
import './App.css';
import TopazDemo from './TopazDemo';

const vendorId = 0x0801;
const productId = 0x0002;
const filters = [{ vendorId, productId }];
const barcodeVendorId = 0x05e0;
const barcodeProductId = 0x1300;
const barcodeFilters = [{ barcodeVendorId, barcodeProductId }];

function App() {
  const [errMsg, setErrMsg] = useState(undefined);
  const [magStripeString, setMagStripeString] = useState(undefined);
  const [cardReader, setCardReader] = useState(undefined);
  const [barcodeScannerString, setBarcodeScannerString] = useState(undefined);
  const [barcodeScanner, setBarcodeScanner] = useState(undefined);

  function handleConnectedDevice(e) {
    const device = e.device;
    // == on purpose here.
    if (device.productId == productId && device.vendorId == vendorId) {
      setCardReader(device);
    }
    else if (device.productId == barcodeProductId && device.vendorId == barcodeVendorId) {
      setBarcodeScanner(device);
    }
    console.log(`${device.productName} added...`)
  }


  function handleDisconnectedDevice(e) {
    const device = e.device;
    if (device.productId == productId && device.vendorId == vendorId) {
      setCardReader(undefined);
    }
    else if (device.productId == barcodeProductId && device.vendorId == barcodeVendorId) {
      setBarcodeScanner(undefined);
    }
    console.log(`${device.productName} removed...`)
    e.device.oninputreport = undefined;
  }

  // This effect tries to acquire the device if it has already been paired.
  useEffect(() => {
    (async () => {
      if (cardReader) {
        return;
      }
      console.log("looking for devices...");
      const devices = await navigator.hid.getDevices();
      devices.forEach(device => {
        // == on purpose here.
        if (device.productId == productId && device.vendorId == vendorId) {
          console.log("Found a pre-paired reader...");
          setCardReader(device);
        }
        else if (device.productId == barcodeProductId && device.vendorId == barcodeVendorId) {
          setBarcodeScanner(device);
        }
        console.log(`${device.productName} found and already paired.`);
      });
    })()
  })
  // This effect handles the case that the device was plugged in while this component
  // is mounted.
  useEffect(() => {
    navigator.hid.addEventListener("connect", handleConnectedDevice);
    navigator.hid.addEventListener("disconnect", handleDisconnectedDevice);
    return () => {
      navigator.hid.removeEventListener("connect", handleConnectedDevice);
      navigator.hid.removeEventListener("disconnect", handleDisconnectedDevice);
    }
  });

  //This effect instruments a new reader after it's set.
  useEffect(() => {
    console.log("Card reader was just set");
    (async () => {
      try {
        await openHidDevice(cardReader, handleCardRead);
      } catch (err) {
        console.error(err);
        setErrMsg(`Could not open ${cardReader.productName}: ${err}`)
        setCardReader(undefined);
      }
    }
    )();
  }, [cardReader]);

  useEffect(() => {
    console.log("Barcode Scanner was just set");
    (async () => {
      try {
        await openHidDevice(barcodeScanner, handleBarcodeScan);
      } catch (err) {
        console.error(err);
        setErrMsg(`Could not open ${barcodeScanner.productName}: ${err}`)
        setBarcodeScanner(undefined);
      }
    }
    )();
  }, [barcodeScanner]);

  async function openHidDevice(device, reportCallback) {
    if (!device) {
      return;
    }

    if (device.opened) {
      console.log(`${device.productName} was already open`);
      return;
    }

    console.log(`Opening ${device.productName}...`)
    await device.open();
    device.oninputreport = reportCallback;
    console.log(`${device.productName} is ready.`)
  }
  async function requestPairReader(e) {
    // Just checking
    if (cardReader) {
      return
    }
    console.log("attempting to pair an un-paired reader.");
    try {
      const selected = await navigator.hid.requestDevice({ filters });
      if (!selected || selected.length === 0) {
        return
      }
      setCardReader(selected[0]);

    } catch (err) {
      console.error(err);
      setErrMsg(`Could not pair the device: ${err}`)
    }
  }

  async function requestPairScanner(e) {
    // Just checking
    if (barcodeScanner) {
      return
    }
    console.log("attempting to pair an un-paired reader.");
    try {
      const selected = await navigator.hid.requestDevice({ filters });
      if (!selected || selected.length === 0) {
        return
      }
      setBarcodeScanner(selected[0]);

    } catch (err) {
      console.error(err);
      setErrMsg(`Could not pair the device: ${err}`)
    }
  }
  
  function handleCardRead(e) {
    setMagStripeString(new TextDecoder("utf-8").decode(e.data));
  }

  function handleBarcodeScan(e) {
    setBarcodeScannerString(new TextDecoder("utf-8").decode(e.data));
  }

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div>
        <img src="data:image/png;base64," alt="logo" />
      </div>
      <button onClick={requestPairReader} disabled={!!cardReader && cardReader.opened}>Request Reader</button>
      <div>
        <span>Mag stripe data:</span>
        <pre>{magStripeString}</pre>
      </div>
      {errMsg && <div>
        <span>Mag stripe error:</span>
        <pre>{errMsg}</pre>
      </div>
      }
      <div>
        <img src={scannerImageData}/>
      </div>
      <button onClick={requestPairScanner} disabled={!!barcodeScanner && barcodeScanner.opened}>Request Scanner</button>
  
      <div>
        <span>Barcode Scanner data:</span>
        <pre>{barcodeScannerString}</pre>
      </div>
      {errMsg && (<div> <span>Barcode Scanner"</span> </div>)}
      <TopazDemo/>
    </div>
  );
}

export default App;

const scannerImageData = "data:image/png;base64,";